import React from 'react';
import '../styles/MedicalVacationPage.css';
import treatmentPackagesImage from './images/treatment-packages.jpg';
import accommodationImage from './images/accommodation.jpg';
import testimonialsImage from './images/testimonials.jpg';

const MedicalVacationPage = () => {
    return (
        <div className="medical-vacation-container">
            <h1>Medical Vacation</h1>
            <div className="content">
                <img src={treatmentPackagesImage} alt="Treatment Packages" className="responsive-image" />
                <p>Our medical vacation packages combine top-notch medical care with luxurious stay options. These comprehensive packages ensure patients receive the best treatments while enjoying a relaxing vacation in Dubai.</p>
                <img src={accommodationImage} alt="Accommodation" className="responsive-image" />
                <p>Enjoy luxury accommodation with world-class facilities and services, ensuring a comfortable and relaxing stay.</p>
                <img src={testimonialsImage} alt="Testimonials" className="responsive-image" />
                <p>Read testimonials from our satisfied clients who have experienced our exceptional medical vacation packages.</p>
            </div>
        </div>
    );
};

export default MedicalVacationPage;
